def addChild(numChildren, nestingLevel):
    result = []
    if nestingLevel == 0:
        return result
    for i in range(numChildren):
        child = QStandardItem(
                "Child num {}, nesting level {}".format(i + 1, nestingLevel))
        if i == 0:
            child.appendRow(addChild(numChildren, nestingLevel - 1))
        result.append(child)

